import React, {Component} from "react";
import { useParams } from "react-router-dom";


//singular film rendering
function Film() {
    let { id } = useParams();
    
    fetch("http://localhost:8080/api/film/:id")

    
    
    return (
        <h1>{id}</h1>
    )
}

export default Film;
